import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ role }) {
  return (
    <nav>
      <ul>
        <li><Link to="/profile">Profile</Link></li>
        {role === 'seller' && <li><Link to="/store">Store</Link></li>}
      </ul>
    </nav>
  );
}

export default Navbar;
